<p>&nbsp;</p>
<h1 style="text-align: center;"></h1>
<p style="text-align: center;"><a href="http://przynetypg.pl/wp-content/uploads/2014/10/grzechnik.jpg"><img class="size-large wp-image-91 alignnone" src="http://przynetypg.pl/wp-content/uploads/2014/10/grzechnik-1024x815.jpg" alt="grzechnik" width="800" height="636" /></a></p>
<p style="text-align: center;"><span class="_5yl5" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0"><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0"><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$4:0">Nazywam sie<span style="color: #ccffcc;"> Pawel Grzecznik,</span> mieszkam w Brodnicy </span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$5:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$6:0">Witam wszystkich w moim wirtualnym warsztacie pracy.</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$7:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$8:0">Na dobry poczatek pare slow o mnie i mojej pasji ktora stala sie moja praca .</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$9:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$10:0">Od wielu lat zajmuje sie recznym wykonywaniem przynet wedkarskich.</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$11:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$12:0">W mojej pracowni powstaja woblery , blystki wahadlowe i blystki obrotowe.</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$13:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$14:0">Produkuje przynety na </span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$15:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$16:0">- lososie</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$17:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$18:0">-trocie</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$19:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$20:0">-pstragi</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$21:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$22:0">-szczupaki </span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$23:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$24:0">-sandacze</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$25:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$26:0">-sumy</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$27:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$28:0">-klenie</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$29:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$30:0">-jazie</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$31:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$32:0">-okonie</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$33:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$34:0">W szczegolnosci upodobalem sobie polowy ryb lososiowatych, tym rybom poswiecam najwiecej czasu i uwagi, to wlasnie one ucza mnie cierpliwosci i pokory.</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$35:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$36:0">Doswiadczenia jakie zdobywam nad woda, oraz przemyslenia dotyczace polowow, pozwalaja mi na tworzenie takich wlasnie przynet.</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$37:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$38:0">Co po za tym ?</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$39:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$40:0">Kazda wolna chwile spedzam nad rzekami, to tam powstaja moje pomysly ktore potem realizuje w pracowni. </span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$41:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$42:0">Lubie poranna kawe, dobry zart .</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$43:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$44:0">Mam dystans do siebie i tego co robie .</span><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$45:0" /><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$46:0">Robie to co lubie i Wam wszystkim tez tego zycze . </span></span></span></p>
<p style="text-align: center;"><span class="_5yl5" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0"><span data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0"><br data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$47:0" /><span style="color: #ccffcc;" data-reactid=".44.$mid=11412687296610=24a05728973ceb1f006.2:0.0.0.0.0.0.$end:0:$48:0">Z wedkarskimi pozdrowieniami Pawel Grzecznik.</span></span></span></p>
